import { Footer } from "./Footer"
import { Header } from "./Header"



export const AdvisterZone = () => {

    if (sessionStorage.getItem("advisterToken") != null)
        nav("../advisterZone")
    
    return (
        <>
            <Header advisterZone={false}></Header>
            <h1>advister zone</h1>
            <Footer></Footer>
        </>
    )
}
